import React from 'react'

export default function Items(props) {
    const item = props.item,
          playerstats = props.playerstats
    return (
        <section>
            <h3>{item.title}</h3>
            <table>
            {console.log(item.playerstats)}
            </table>
           
        </section>
    )
}
